import React from "react";
import {
  Dialog, DialogTitle, DialogContent, DialogActions,
  Box, TextField, Button, MenuItem, InputAdornment
} from "@mui/material";
import LocalGasStationOutlinedIcon from '@mui/icons-material/LocalGasStationOutlined';
import LocationOnOutlinedIcon from '@mui/icons-material/LocationOnOutlined';
import DateRangeOutlinedIcon from '@mui/icons-material/DateRangeOutlined';
import PinDropOutlinedIcon from '@mui/icons-material/PinDropOutlined';
import LocalShippingOutlinedIcon from '@mui/icons-material/LocalShippingOutlined';

const fuelTypes = [
  { value: 'petrol', label: 'Petrol' },
  { value: 'diesel', label: 'Diesel' }
];

const serviceProviders = [
  { value: 'hp', label: 'HP' },
  { value: 'indian-oil', label: 'Indian Oil' },
  { value: 'bharat-petroleum', label: 'Bharat Petroleum' },
  { value: 'shell', label: 'Shell' },
  { value: 'nayara', label: 'Nayara' },
  { value: 'reliance', label: 'Reliance' }
];

export default function OrderForm({ open, onClose }) {
  return (
    <Dialog open={open} onClose={onClose} maxWidth="xs" fullWidth>
      <DialogTitle sx={{ fontWeight: 700, color: "#e23744", textAlign: "center" }}>
        Place Your Order
      </DialogTitle>
      <DialogContent sx={{ pb: 1 }}>
        <Box
          component="form"
          sx={{ display: "flex", flexDirection: "column", gap: 2, mt: 1 }}
        >
          <TextField
            select
            required
            label="Fuel Type"
            defaultValue=""
            fullWidth
            InputProps={{
              startAdornment: (
                <InputAdornment position="start">
                  <LocalGasStationOutlinedIcon color="action" />
                </InputAdornment>
              )
            }}
          >
            {fuelTypes.map(option => (
              <MenuItem key={option.value} value={option.value}>
                {option.label}
              </MenuItem>
            ))}
          </TextField>

          <TextField
            required
            type="number"
            label="Quantity"
            placeholder="e.g. 10"
            fullWidth
            InputProps={{
              endAdornment: <InputAdornment position="end">Ltr</InputAdornment>
            }}
          />

          <TextField
            required
            type="date"
            label="Delivery Date"
            InputLabelProps={{ shrink: true }}
            fullWidth
            InputProps={{
              startAdornment: (
                <InputAdornment position="start">
                  <DateRangeOutlinedIcon color="action" />
                </InputAdornment>
              )
            }}
          />

          <TextField
            required
            label="Pincode"
            type="number"
            placeholder="Enter area pincode"
            fullWidth
            InputProps={{
              startAdornment: (
                <InputAdornment position="start">
                  <PinDropOutlinedIcon color="action" />
                </InputAdornment>
              )
            }}
            inputProps={{ maxLength: 6 }}
          />

          <TextField
            select
            required
            label="Service Provider"
            defaultValue=""
            fullWidth
            InputProps={{
              startAdornment: (
                <InputAdornment position="start">
                  <LocalShippingOutlinedIcon color="action" />
                </InputAdornment>
              )
            }}
          >
            {serviceProviders.map(option => (
              <MenuItem key={option.value} value={option.value}>
                {option.label}
              </MenuItem>
            ))}
          </TextField>

          <TextField
            required
            label="Delivery Address"
            placeholder="Enter delivery address"
            fullWidth
            InputProps={{
              startAdornment: (
                <InputAdornment position="start">
                  <LocationOnOutlinedIcon color="action" />
                </InputAdornment>
              )
            }}
          />
        </Box>
      </DialogContent>
      <DialogActions sx={{ px: 3, pb: 2, gap: 1 }}>
        <Button
          variant="contained"
          color="primary"
          sx={{
            background: "#e23744",
            fontWeight: 700,
            borderRadius: 3,
            px: 3,
            boxShadow: "none"
          }}
          fullWidth
        >
          SUBMIT ORDER
        </Button>
        <Button
          variant="outlined"
          onClick={onClose}
          sx={{
            borderColor: "#e23744",
            color: "#e23744",
            borderRadius: 3,
            px: 3,
            fontWeight: 600
          }}
          fullWidth
        >
          CANCEL
        </Button>
      </DialogActions>
    </Dialog>
  );
}
